import React from "react";

import "./App.css";

import SearchStop from "./components/SearchStop";

require("dotenv").config();

function App() {
  return (
    <div className="App">
      <label style={{ padding: "10px" }} htmlFor="states-autocomplete">
        Demo Application for Live bus departurs in Australia
      </label>
      <SearchStop />
    </div>
  );
}

export default App;
